import React, { Component } from 'react';
import {Helmet} from 'react-helmet';
import Image1 from '../products/09.jpg'
import Image2 from '../products/19.jpg'
import Image3 from '../products/20.jpg'
import Carousel from 'react-bootstrap/Carousel';
import './Carousel.css';
const title = 'LiteCnC';
class ProductList extends Component {
    render() {
        return (
            <React.Fragment>

            <Helmet>
                <title>LiteCnC</title>
            </Helmet>
                {/* Carousel or slide */}
                <Carousel>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={Image1}
          alt="First slide"
        />
        <Carousel.Caption>

          <h1 className='c'>Self Drive cars</h1>
          <p>Rent a car to get around for as much time as you wish driving yourself..</p>
          <button className='cbtn'>Book Now</button>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={Image2}
          alt="Second slide"
        />

        <Carousel.Caption>
          <h1>Get tour tips</h1>
          <p>Rent a car and hire a private tour guide to help you as much time as you need to travel.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={Image3}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h1>We reach out to you</h1>
          <p>
           We bring you a car as soon as you land off the plane or arrive in the country.
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
                {/* Content found on a landing page after slider */}

            </React.Fragment>

        );
    }
}

export default ProductList;
